import { INTERVALO } from "./actions"



const initialSate={
    intervalo:[],
}



export default function rootReducer(state=initialSate,actions){
    switch(actions.type){
        case INTERVALO:
            return{
                ...state,
                intervalo:actions.payload
            }
        default:
            return state
    }
}
